import React from 'react';
//import { Paragraph } from '@contentful/f36-components';
import { /* useCMA, */ useSDK } from '@contentful/react-apps-toolkit';
import JsonObject from '../field_types/jsonObject';

const Field = () => {
  const sdk = useSDK();
  /*
     To use the cma, inject it as follows.
     If it is not needed, you can remove the next line.
  */
  // const cma = useCMA();
  // If you only want to extend Contentful's default editing experience
  // reuse Contentful's editor components
  // -> https://www.contentful.com/developers/docs/extensibility/field-editors/
debugger

  let returnObject = undefined

  switch(sdk.field.type) { 
    case "Object":
      returnObject =  <JsonObject sdk={sdk}></JsonObject>
    break;
    case "Short Text":
      returnObject =  <JsonObject sdk={sdk}></JsonObject>
    break;
    case "Short Text List":
      returnObject =  <JsonObject sdk={sdk}></JsonObject>
    break;
    case "Long Text":
      returnObject =  <JsonObject sdk={sdk}></JsonObject>
    break;
    case "Rich Text":
      returnObject =  <JsonObject sdk={sdk}></JsonObject>
    break;
    case "Number, Decimal":
      returnObject =  <JsonObject sdk={sdk}></JsonObject>
    break;
    case "Date and Time":
      returnObject =  <JsonObject sdk={sdk}></JsonObject>
    break;
    case "Location":
      returnObject =  <JsonObject sdk={sdk}></JsonObject>
    break;
    case "Boolean":
      returnObject =  <JsonObject sdk={sdk}></JsonObject>
    break;
    case "Entry Reference":
      returnObject =  <JsonObject sdk={sdk}></JsonObject>
    break;
    case "Entry Reference, list":
      returnObject =  <JsonObject sdk={sdk}></JsonObject>
    break;
    case "Asset Reference":
      returnObject =  <JsonObject sdk={sdk}></JsonObject>
    break;
    case "Asset Reference, list":
      returnObject =  <JsonObject sdk={sdk}></JsonObject>
    break;
    default: 
    break
  }


  return <div>{returnObject}</div>;
};

export default Field;
